import './App.css';
import FilesUploadComponent from './fileupload';
class Add extends React.Component {
   constructor(props) {
      super(props);
      this.state = {
        name: '',
        bio:'',
        linkedinlink:'',
        githublink:''
      };
    }
    render() {
       return (
          <div>
             <h1>Add Profile</h1>
             <br />
             <br />
             <div>
             <FilesUploadComponent />
             </div>
          </div>
       )
    }
  }
  export default Add;
